import { useState } from 'react'
import './Formulaire.scss'
export default function Formulaire () {


    const [firstName, setFirstName] = useState('')
    const [lastName, setLastName] = useState('')
    const [phone, setPhone] = useState('')
    const [email, setEmail] = useState('')
    const [message, setMessage] = useState('')

const handleSubmit = (event) => {
    event.preventDefault()
    console.log(firstName);
}

const Formulaire = () => {

    return(
        <div> 
            <h1>Contacez-nous</h1>
            <form onSubmit={handleSubmit}>
            <div className='formulaire'>
                <label htmlFor='lastName'>Nom</label>
                <input required type='text' name='lastName' id='lastName' onChange={(event) => setLastName(event.target.value)}></input>
                <br />
                <label htmlFor='firstName'>Prenom</label>
                <input required type='text' name='firstName' id='firstName' onChange={(event) => setFirstName(event.target.value)}></input>
                <br />
                <label htmlFor='phone'>Téléphone</label>
                <input required type='tel' name='phone' id='phone' onChange={(event) => setPhone(event.target.value)}></input>
                <br />
                <label htmlFor='email'>Email</label>
                <input required type='email' name='email' id='email' onChange={(event) => setEmail(event.target.value)}></input>
                <br />
                <label htmlFor='message'>Message</label>
                <textarea required type='text' name='message' id='message' onChange={(event) => setMessage(event.target.value)}></textarea>
                <button>Envoyer</button>
            </div>
            </form>
        </div>
    )
}
}
